import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  // Import Routes and Route from react-router-dom
import Navbar from './Navbar';  // Assuming you have a Navbar component
import BookList from './BookList';  // Assuming you have a BookList component
import MyIssuedBooks from './MyIssuedBooks';  // Assuming you have a MyIssuedBooks component
import Login from './Login';  // Assuming you have a Login component
import Signup from './Signup';  // Assuming you have a Signup component

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>  {/* Wrap all routes inside <Routes> */}
        <Route path="/" element={<Home />} />
        <Route path="/booklist" element={<BookList />} />
        <Route path="/myissuedbooks" element={<MyIssuedBooks />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
      </Routes>
    </Router>
  );
};

export default App;
